import './App.css';
import AudioComponent from './components/AudioCom'
import ReactPlayer from 'react-player'


function App() {
  return (
    <div className="App">
      <header className="App-header">
          <AudioComponent/>
          <ReactPlayer src= "./assets/song.mp3"/>
      </header>

    </div>
  );
}

export default App;
